import './ArticleItem.css'

function ArticleItem({ thumbnail, title, desc }) {
    return (
        <div className='article'>
            <div className=''>
                <img src={thumbnail}></img>
            </div>
            <div>
                {title}
            </div>
            <div>
                {desc}
            </div>
        </div>
    );
};

export default ArticleItem;
